const myImage = new Image();
myImage.src =
  "data:image/png;base64,";

myImage.addEventListener("load", function () {
  const canvas = document.getElementById("canvas1");
  const ctx = canvas.getContext("2d");
  canvas.width = 360;
  canvas.height = 360;
  ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
  const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  let particleArray = [];
  const numberOfParticles = 3000;

  let mappedImage = [];
  for (let y = 0; y < canvas.height; y++) {
    let row = [];
    for (let x = 0; x < canvas.width; x++) {
      const red = pixels.data[y * 4 * pixels.width + x * 4];
      const green = pixels.data[y * 4 * pixels.width + (x * 4 + 1)];
      const blue = pixels.data[y * 4 * pixels.width + (x * 4 + 2)];
      const brightness = calculateRelativeBrightness(red, green, blue);
      const cell = [
        (cellBrightness = brightness),
        (cellColor = "rgb(" + red + "," + green + "," + blue + ")"),
      ];
      row.push(cell);
    }
    mappedImage.push(row);
  }

  function calculateRelativeBrightness(red, green, blue) {
    return (
      Math.sqrt(
        red * red * 0.299 + green * green * 0.587 + blue * blue * 0.114
      ) / 100
    );
  }

  class Particle {
    constructor() {
      this.x = Math.random() * canvas.width;
      this.y = 0;
      this.speed = 0;
      this.velocity = Math.random() * 0.5 + 0.1;
      this.size = Math.random() * 1.5 + 1;
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
      this.angle = 0;
      this.move = true;
    }

    update() {
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
      if (
        mappedImage[this.position1] &&
        mappedImage[this.position1][this.position2]
      ) {
        this.speed = mappedImage[this.position1][this.position2][0];
      }
      let movement = 2.5 - this.speed + this.velocity;
      this.angle += this.speed * 0.03;

      this.y += movement;
      //this.x += movement * Math.random() * 0.5 +  0.5;
      if (this.y >= canvas.height) {
        this.move = false;
        this.y = 0;
        this.x = Math.random() * canvas.width;
      }

      if (this.x >= canvas.width) {
        this.x = 0;
      }

      if (this.angle > 360) this.angle = 0;
    }

    draw() {
      ctx.beginPath();
      if (
        mappedImage[this.position1] &&
        mappedImage[this.position1][this.position2]
      ) {
        ctx.fillStyle = mappedImage[this.position1][this.position2][1];
      }
      //console.log(ctx.fillStyle);
      ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
      ctx.fill();
    }
  } //end Particle Class

  function init() {
    for (let i = 0; i < numberOfParticles; i++) {
      particleArray.push(new Particle());
    }
  }
  init();

  function animate() {
    ctx.globalAlpha = 0.05;
    ctx.fillStyle = "rgb(0,0,0)";
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.2;
    for (let i = 0; i < particleArray.length; i++) {
      if(particleArray[i].move === true) {
        particleArray[i].update();
        ctx.globalAlpha = particleArray[i].speed * 0.5;
        particleArray[i].draw();
      }

    }
    requestAnimationFrame(animate);
  }
  animate();


  setInterval(reset, 40000)


  function reset() {
    particleArray.forEach((particle) => {
      if(particle.y !== 0) {
        particle.y =0;
      }
      particle.move= true;
    })
  }
});
